import React from 'react';
import logo from './resources/nature.jpg';
import iphone from './resources/sport.jpg';

import data from './data/products.json';
import './App.css';
import { useParams,useRouteMatch } from 'react-router-dom';


class ProductPage extends React.Component ({match}) {


    render(){
        const location = window.location.pathname.split('/')[2] 
        const urle = data.filter( element => element.id === location)[0];
        
        
        return(
            <div style={{marginTop: 100}}>
                <p >{urle.name}</p>
                <p >{urle.price}</p>
                <p >{urle.location}</p>
                <p >{urle.images}</p>
            </div>
        )
    }
}

export default ProductPage;
